  `total_time` varchar(10) DEFAULT NULL COMMENT '总体时间',
  `circle_num` varchar(2) NOT NULL COMMENT '剩余圈数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3955 DEFAULT CHARSET=utf8;

